import React from 'react'

function MyInfo(){
    return (
        <div>
            <h1>Tirivashe Shamhu</h1>
            <p>I am in college right now and I would kie to go to: </p>
            <ul>
                <li>Bora Bora</li>
                <li>Paris</li>
                <li>London</li>
            </ul>
        </div>
    )
}

export default MyInfo;
